The kitchen can be an unsafe place for young children, but that won’t stop their interest in exploring all the things in this crafty place. Have them play in the BabyBus kitchen and try out all the fun activities such as preparing food, cooking and juicing, in a less dangerous manner!

Fun features: 
- Explore an open fridge;
- Stir-fry your favorite food; 
- Make the tastiest juice!

See how much your new friends are going to like your cooking. Become the chef of the kitchen where you will master the art of preparing food and extracting juice. Be creative!

Bimi Boo with you again! This time you will go to visit friends of Bimi Boo, who live in a treehouse. You will meet a sly cat, funny rabbit and cute squirrel. There is an exciting game in the house of your baby in which he can help to bring order, to place everything in its place and feed friends of Bimi Boo.

15 different games will fascinate a child with not only bright colors and funny animations, but also with interesting and clear tasks such as:

- Arrange items by color, shape, number and size;
- Pick up items within the meaning of;
- Arrange the geometric shapes according to silhouette;
- Sort items in its place
- Feed animals in a right way;
- Restore pictures from memory.

Together with Bimi Boo Shapes & Colors, your baby will learn to distinguish shapes, colors, texture and quantity. The game also improves fine motor skills, attention and intelligence. It contains everything you need for a fun and healthy development of the child.

The Junk Food Monster is in Labyrinth Town! He kidnaps children and pandas with bad eating habits. Our little panda, Miumiu, doesn’t eat healthy food and the horrible monster has locked her up in a cage. She is somewhere in the maze! Help the little panda,Kiki, to rescue Miumiu through a wondrous labyrinth full of junk food!

Fun features:
- Fight against the monster in the amazing 3D labyrinth;
- Explore the 3D labyrinth, the town and the castle with the little panda;
- Play 3D interactive games in the maze and save the cute panda!

The food we eat can affect our health. Therefore, we may need to make some changes in our diet. This wonderful adventure teaches children what food they should avoid and why. There are many fun challenges in the labyrinth and activities to play with the little panda. Join the fun in this cute 3D maze with Kiki, your favourite panda! Play 3D for free!
